import React from "react";
import {BrowserRouter as Router,Routes,Route} from 'react-router-dom';
import Home from "./Components/Home/Home";
import Nav from "./Components/Nav/Nav";






function App() {
  return ( <div>
    <Router>
       <Nav/>
       <Routes>

         <Route path="/" exact component={Home}/>
       </Routes>
    </Router>
    <p>test</p>


  </div>);
}


export default App;
